import React from "react";
import "./post.css";
function Post(props) {
  return (
    <div className="propsWrapper">
      <div>
        img className="img" src={props.img} alt="" />
        <h1>{props.name}</h1>
        <p className="desc">{props.desc}</p>
        <p userName="userName">{props.userName}</p>
        <img className="userImg" src={props.userImg} alt="" />
      </div>
    </div>
  );
}
export default Post;
